import React from 'react';
import '../App.css';
import Body from "./Body";
import Navbarr from "./Navbarr.js";
import Footer from "./Footer";
  

function App(){
    return (
        <div className = 'App'>
            <Navbarr />
            <Body />
            <Footer />
        </div>
    )
}


export default App;
